import React, { useEffect, useState } from "react";
import Ques from "./Questions";
const Subject =()=>{
    const [Subject,setSubject]=useState([]);
    useEffect(()=>{

setSubject(()=>
    {
        return Array.from(new Set(Ques.map((val)=>
        {return val.subject}))
                        )
    }
        )
    },[])
    return (
        <>
       <h2>{Subject[0]}</h2>
       <h2>{Subject[1]}</h2>
       {Subject.map((val)=>{
        <h2>val</h2>
       })}
        </>
    )
}
export default Subject;
